const A = ()=>{
    return <h1>SIEMA</h1>;
}
class MainAPP extends React.Component{
    constructor(props){
        super(props);
        this.navElement = React.createRef(true);
    }
    render(){
        return(
        <>
            <BrowserRouter>
                <Route path='/' exact component={NavigationComponent}/>
                <Route path='/doctors' exact component={DoctorComponent}/>
                <Route path='/login' exact component={NavigationComponent,LoginComponent}/>

            </BrowserRouter>
            {/* <NavigationComponent ref={this.navElement} />
            <div>{<DoctorComponent/> ? this.navElement.current==="doctors":null}</div>
            <div>{<LoginComponent/> ? this.navElement.current==="login":null}</div> */}

        </>
        );



    }
}

export default MainAPP;
